<!DOCTYPE html>
<html>
<head>
	<meta charset="utf-8"/>
    <title>Happy Lantern Festive</title>
    <style>
        #fork{
            position: fixed;
            display: none;
            animation: translate 2.5s;
            transform: translate(10);
            animation-name: t1;
            animation-direction: normal;
        }
       
         #knife{
            position: fixed;
            display: none;
            animation: translate 2.5s;
            transform: translate(10);
            animation-direction: normal;
            animation-name: t2;
        }
        
        #heart{
            display: none;
            transform-origin: 50% center;
            position: fixed;
            animation-name: rotating;
            animation-duration: 2.5s;
            animation-play-state: running;
            animation-iteration-count: infinite;
            animation-timing-function: ease-out;
        }
        
        @-webkit-keyframes rotating {
        from { -webkit-transform: rotate(0deg); }
        to { -webkit-transform: rotate(360deg); }
        }
        #dish{
            visibility: hidden;
        }
        #text{
            visibility: hidden;
            }
        @keyframes t1 {
            0%{transform: translateX(850px);}
            100%{transform: translateX(10px);}
        }
        
        @keyframes t2 {
            0%{transform: translateX(-750px);}
            100%{transform: translateX(8px);}
        }
    </style>
    </head>

    <script>
        var fork = document.getElementById("fork");
        var knife = document.getElementById("knife");
        var text = document.getElementById("text");
        var dish = document.getElementById("dish");
        var heart = document.getElementById("heart");
        var dishes = document.getElementById("dishes");
        
        dishes.addEventListener("click", function () {
            dish.style.visibility = "visible";
        });
        
        dish.addEventListener("click", function () {
            fork.style.display = "inline";
            knife.style.display = "inline";
            text.style.visibility = "visible";
        
        });
        
        fork.addEventListener("click", function () {
            heart.style.display = "inline";
        }); 
        
        var msg = false;
        heart.addEventListener("click", function () {
        
        if (msg == false){
        var text1 = document.createElement("img");
        text1.src = "sss.svg";
        text1.style.position = "fixed";
        text1.style.bottom = "0";
        text1.style.top = "0";
        text1.style.left = "0";
        text1.style.right = "0";
        text1.style.margin = "auto";
        document.body.appendChild(text1);
        msg = true;
            
        text1.addEventListener("click", function(){
            document.body.removeChild(text1);
        })
        }
    });
        </script>
